export default function InteractiveMap() {
    const mapElement = document.querySelector(MAP_SELECTOR);

    if (mapElement) {
        const svgElementBounds = L.latLngBounds([
            [
                17.664529360860534,
                -127.58283641263382,
            ],
            [
                50.645410082230285,
                -68.32386393862258,
            ],
        ]);

        // Create the map object.
        const map = L.map('map', {
            center: [
                35.09212931551506,
                -55.65680292332362,
            ],
            panControl: false,
            zoomControl: true,
            doubleClickZoom: false,
            dragging: true,
            boxZoom: true,
            scrollWheelZoom: true,
            trackResize: true,
            attributionControl: false,
            zoomSnap: 0,
            maxZoom: 10,
        });

        map.setMinZoom(map.getBoundsZoom(svgElementBounds));

        L.svgOverlay(svgElement, svgElementBounds).addTo(map);

        // Automatically zoom the map to the boundaries.
        map.fitBounds(svgElementBounds);

        map.on('resize', () => {
            map.whenReady(() => {
                setTimeout(() => {
                    map.invalidateSize();
                    map.fitBounds(svgElementBounds);
                }, 1000);
            });
        });

        const markers = L.markerClusterGroup({
            maxClusterRadius: 40,
        }).addTo(map);

        offices.map((office) => {
            let marker = L.marker(
                [
                    office.lat,
                    office.lng,
                ],
                {
                    title: office.name,
                    icon: iconsObj[office?.type],
                },
            );

            const customPopup = `<span>${office.name}, ${office.state}</span>${office.address}<br><a href="https://www.google.com/maps/search/?api=1&query=${office.lat}%2C${office.lng}" target="_blank">See on map</a>`;

            marker.bindPopup(customPopup, {
                maxWidth: '223',
                className: 'map-popup',
                closeButton: false,
                maxHeight: 214,
                offset: [
                    125,
                    232,
                ],
            });

            markers.addLayer(marker);

            marker.on('popupopen', function () {
                marker._icon.classList.add('is-active');
            });

            marker.on('popupclose', function () {
                marker._icon?.classList.remove('is-active');
            });
        });

        document.querySelectorAll(BLOCK_SELECTOR).forEach((template) => {
            const mapNavs = template.querySelectorAll(MAP_NAVS_SELECTOR);
            const allMarkers = markers.getLayers();

            mapNavs.forEach((checkbox) => {
                checkbox.addEventListener('change', function () {
                    markers.getLayers().forEach((marker) => {
                        markers.removeLayer(marker);
                    });

                    const checkedCheckboxes = template.querySelectorAll(`${MAP_NAVS_SELECTOR}:checked`);

                    if (checkedCheckboxes.length > 0) {
                        const currentValues = Array.from(checkedCheckboxes).map((checkbox) => checkbox.value);

                        const filtered = allMarkers.filter((marker) => {
                            return currentValues.includes(marker.options.icon.options.className);
                        });

                        filtered.forEach((marker) => {
                            markers.addLayer(marker);
                        });
                    } else {
                        allMarkers.forEach((marker) => {
                            markers.addLayer(marker);
                        });
                    }
                });
            });
        });
    }
}
